class Solution {
    /**
    Given a positive floating point number, it can be decomposed into
    an integer part (largest integer smaller than given number) and decimals
    (leftover part always smaller than 1).

    Return the decimal part of the number.
    >>> truncate_number(3.5)
    0.5
     */
    public double truncate_number(double number) {
        // Extract integer part by casting to int (which truncates towards zero)
        long integerPart = (long) number;
        // Calculate decimal part by subtracting the integer part from the original number
        double decimalPart = number - integerPart;
        return decimalPart;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
            s.truncate_number(3.5) == 0.5,
            Math.abs(s.truncate_number(1.33) - 0.33) < 1e-6,
            Math.abs(s.truncate_number(123.456) - 0.456) < 1e-6
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

