class Solution {
    /**
    You're given a list of deposit and withdrawal operations on a bank account that starts with
    zero balance. Your task is to detect if at any point the balance of the account falls below zero, 
    and at that point the function should return true. Otherwise, it should return false.
    >>> below_zero(Arrays.asList(1, 2, 3))
    false
    >>> below_zero(Arrays.asList(1, 2, -4, 5))
    true
     */
    public boolean below_zero(List<Integer> operations) {
        int balance = 0;

        for (int op : operations) {
            balance += op;
            if (balance < 0) {
                return true;
            }
        }

        return false;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.below_zero(new ArrayList<>(Arrays.asList())),
                !s.below_zero(new ArrayList<>(Arrays.asList(1, 2, -3, 1, 2, -3))),
                s.below_zero(new ArrayList<>(Arrays.asList(1, 2, -4, 5, 6))),
                !s.below_zero(new ArrayList<>(Arrays.asList(1, -1, 2, -2, 5, -5, 4, -4))),
                s.below_zero(new ArrayList<>(Arrays.asList(1, -1, 2, -2, 5, -5, 4, -5))),
                s.below_zero(new ArrayList<>(Arrays.asList(1, -2, 2, -2, 5, -5, 4, -4)))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

