    /**
    Input are two strings a and b consisting only of 1s and 0s.
    Perform binary XOR on these inputs and return result also as a string.
    >>> string_xor("010", "110")
    "100"
     */
    public String string_xor(String a, String b) {
        // Ensure both strings are of equal length by padding with leading zeros if necessary
        int maxLen = Math.max(a.length(), b.length());
        a = String.format("%" + maxLen + "s", a).replace(' ', '0');
        b = String.format("%" + maxLen + "s", b).replace(' ', '0');

        StringBuilder result = new StringBuilder();
        for (int i = 0; i < maxLen; i++) {
            // XOR the bits and append to the result string
            if (a.charAt(i) == b.charAt(i)) {
                result.append("0");
            } else {
                result.append("1");
            }
        }

        return result.toString();
    }
}

