        // Parse each note and convert it to its corresponding beat count
        List<Integer> beatsList = new ArrayList<>();
        for (String note : notes) {
            if (noteToBeats.containsKey(note)) {
                beatsList.add(noteToBeats.get(note));
            }
        }

        return beatsList;
    }

