class Solution {
    /**
    Find how many times a given substring can be found in the original string. Count overlapping cases.
    >>> how_many_times("", "a")
    0
    >>> how_many_times("aaa", "a")
    3
    >>> how_many_times("aaaa", "aa")
    3
     */
    public int how_many_times(String string, String substring) {
        if (substring.isEmpty()) return 0; // Edge case: if the substring is empty

        int count = 0;
        int start = 0;

        while (start < string.length()) {
            int index = string.indexOf(substring, start);
            if (index == -1) break; // No more occurrences found
            count++;
            start = index + 1; // Move start to the next character after the current match
        }

        return count;
    }
}

