class Solution {
    public List<Double> rescale_to_unit(List<Double> numbers) {
        double minNum = Double.MAX_VALUE;
        double maxNum = Double.MIN_VALUE;

        // Find the minimum and maximum values in the list
        for (Double num : numbers) {
            if (num < minNum) {
                minNum = num;
            }
            if (num > maxNum) {
                maxNum = num;
            }
        }

        List<Double> rescaledNumbers = new ArrayList<>();
        // Apply the linear transformation to each number
        for (Double num : numbers) {
            double transformedValue = (num - minNum) / (maxNum - minNum);
            rescaledNumbers.add(transformedValue);
        }

        return rescaledNumbers;
    }
}

