class Solution {
    /**
     * Input is a space-delimited string of numberals from 'zero' to 'nine'.
     * Valid choices are 'zero', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight' and 'nine'.
     * Return the string with numbers sorted from smallest to largest
     *
     * @param numbers The input string containing number words.
     * @return A string with the number words sorted from smallest to largest.
     */
    public String sort_numbers(String numbers) {
        // Mapping of number words to their numeric values
        Map<String, Integer> numMap = new HashMap<>();
        numMap.put("zero", 0);
        numMap.put("one", 1);
        numMap.put("two", 2);
        numMap.put("three", 3);
        numMap.put("four", 4);
        numMap.put("five", 5);
        numMap.put("six", 6);
        numMap.put("seven", 7);
        numMap.put("eight", 8);
        numMap.put("nine", 9);

        // Split the input string into individual number words
        String[] numWords = numbers.split("\\s+");

        // Convert each word to its numeric value and sort them
        Arrays.sort(numWords, (word1, word2) -> {
            return Integer.compare(numMap.get(word1), numMap.get(word2));
        });

        // Join the sorted number words back into a single string
        StringBuilder sortedNumbers = new StringBuilder();
        for (String word : numWords) {
            if (sortedNumbers.length() > 0) {
                sortedNumbers.append(" ");
            }
            sortedNumbers.append(word);
        }

        return sortedNumbers.toString();
    }
}

