    }

    private boolean isPrime(int num) {
        if (num <= 1) return false;
        for (int i = 2; i * i <= num; i++) {
            if (num % i == 0) return false;
        }
        return true;
    }

    private int fib(int num) {
        if (num == 0) return 0;
        else if (num == 1) return 1;
        else {
            int a = 0, b = 1;
            for (int i = 2; i <= num; i++) {
                int temp = a + b;
                a = b;
                b = temp;
            }
            return b;
        }
    }

    private int findPrimeFib(int n) {
        int count = 0;
        int i = 0;
        while (true) {
            int fibNum = fib(i);
            if (isPrime(fibNum)) {
                count++;
                if (count == n) return fibNum;
            }
            i++;
        }
    }
}

