        Solution s = new Solution();
        for (int i = 0; i < 100; i++) {
            String str = random_string(rand.nextInt(10) + 10);
            String encode_str = s.encodeCyclic(str);
            if (!s.decode_cyclic(encode_str).equals(str)) {
                throw new AssertionError();
            }
        }
    }
}

