class Solution {
    public boolean triples_sum_to_zero(List<Integer> l) {
        Collections.sort(l);
        int n = l.size();
        for (int i = 0; i < n - 2; i++) {
            int left = i + 1;
            int right = n - 1;
            while (left < right) {
                int currentSum = l.get(i) + l.get(left) + l.get(right);
                if (currentSum == 0) {
                    return true;
                } else if (currentSum < 0) {
                    left++;
                } else {
                    right--;
                }
            }
        }
        return false;
    }
}

