class Solution {
    /**
    Circular shift the digits of the integer x, shift the digits right by shift
    and return the result as a string.
    If shift > number of digits, return digits reversed.
    >>> circular_shift(12, 1)
    "21"
    >>> circular_shift(12, 2)
    "12"
     */
    public String circular_shift(int x, int shift) {
        // Convert the integer to a string
        String numStr = Integer.toString(x);

        // Determine the number of digits in the integer
        int numDigits = numStr.length();

        // If shift is greater than or equal to the number of digits, reverse the string
        if (shift >= numDigits) {
            return new StringBuilder(numStr).reverse().toString();
        }

        // Perform circular shift
        String shiftedPart = numStr.substring(numDigits - shift);
        String remainingPart = numStr.substring(0, numDigits - shift);

        // Concatenate the two parts to form the result
        return shiftedPart + remainingPart;
    }
}

