class Solution {
    public List<Integer> pluck(List<Integer> arr) {
        // Filter out even numbers and sort them by value and index
        List<Integer> evenNodes = new ArrayList<>();
        for (int i = 0; i < arr.size(); i++) {
            int node = arr.get(i);
            if (node % 2 == 0) {
                evenNodes.add(node);
                evenNodes.add(i); // Store the value and its index
            }
        }

        // Sort the list of even nodes by their values, then by their indices
        Collections.sort(evenNodes, new Comparator<Integer>() {
            @Override
            public int compare(Integer o1, Integer o2) {
                if (o1 < o2) return -1;
                else if (o1 > o2) return 1;
                else return arr.indexOf(o1) - arr.indexOf(o2);
            }
        });

        // Return the smallest even node and its index or an empty list if no even nodes are found
        if (evenNodes.isEmpty()) {
            return new ArrayList<>();
        } else {
            List<Integer> result = new ArrayList<>();
            result.add(evenNodes.get(0));
            result.add(evenNodes.get(1));
            return result;
        }
    }
}

