class Solution {
    public int smallest_change(List<Integer> arr) {
        int n = arr.size();
        int changes = 0;
        int left = 0, right = n - 1;

        while (left < right) {
            if (!arr.get(left).equals(arr.get(right))) {
                changes++;
            }
            left++;
            right--;
        }

        return changes;
    }
}

