class Solution {
    public int hex_key(String num) {
        Set<Character> primeHexDigits = new HashSet<>(Arrays.asList('2', '3', '5', '7', 'B', 'D'));

        int count = 0;
        for (char digit : num.toCharArray()) {
            if (primeHexDigits.contains(digit)) {
                count++;
            }
        }

        return count;
    }

    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        for (int i = 2; i * i <= n; i++) {
            if (n % i == 0) {
