class Solution {
    public String solve(int N) {
        // Convert the integer to its digit sum in decimal form
        int digitSum = 0;
        while (N > 0) {
            digitSum += N % 10;
            N /= 10;
        }

        // Convert the digit sum to binary and return it as a string
        StringBuilder binaryString = new StringBuilder();
        if (digitSum == 0) {
            binaryString.append('0');
        } else {
            while (digitSum > 0) {
                binaryString.insert(0, digitSum % 2);
                digitSum /= 2;
            }
        }

        return binaryString.toString();
    }
}

