class Solution {
    public int starts_one_ends(int n) {
        if (n == 1) {
            return 1;
        } else {
            // For n-digit numbers, there are 2 * (10^(n-1)) - 10^(n-2) numbers that start or end with 1.
            int count = 2 * (int)Math.pow(10, n - 1) - (int)Math.pow(10, n - 2);
            return count;
        }
    }
}

