class Solution {
    public int starts_one_ends(int n) {
        if (n == 1) {
            return 1; // Only one 1-digit number (1 itself)
        }

        // For n > 1, calculate the count of numbers that start or end with 1
        // There are 2 * 9^(n-1) such numbers:
        // - 9^(n-1) for starting with 1 and ending with any digit
        // - 9^(n-1) for ending with 1 and starting with any digit (excluding the overlap)
        return (int)(2 * Math.pow(9, n - 1));
    }
}

