class Solution {
    public int starts_one_ends(int n) {
        if (n == 1) {
            return 1;
        }
        // For numbers starting with 1: 10^(n-1)
        int startWith1 = (int) Math.pow(10, n - 1);
        // For numbers ending with 1: 9 * 10^(n-2) because the first digit can be anything from 1 to 9
        int endWith1 = 9 * (int) Math.pow(10, n - 2);
        // Subtract the overlap where a number both starts and ends with 1
        return startWith1 + endWith1 - 1;
    }
}

