        for (int i = 0; i < lst.size(); i++) {
            List<Integer> row = lst.get(i);
            for (int j = 0; j < row.size(); j++) {
                if (row.get(j).equals(x)) {
                    int colIndex = row.size() - 1 - j;
                    coordinates.add(Arrays.asList(i, colIndex));
                }
            }
        }

        // Sort by rows in ascending order
        Collections.sort(coordinates, (a, b) -> a.get(0) - b.get(0));

        // Sort by columns in descending order within the same row
        for (int i = 0; i < coordinates.size(); i++) {
            for (int j = i + 1; j < coordinates.size(); j++) {
                if (coordinates.get(i).get(0) == coordinates.get(j).get(0)) {
                    if (coordinates.get(i).get(1) < coordinates.get(j).get(1)) {
                        Collections.swap(coordinates, i, j);
                    }
                }
            }
        }

        return coordinates;
    }
}

