class Solution {
    /**
    Write a function that takes a message, and encodes it in such a way that it swaps case of all letters,
    replaces all vowels in the message with the letter that appears 2 places ahead of that vowel in the English alphabet.
    Assume only letters.

    Examples:
    >>> encode("test")
    "TGST"
    >>> encode("This is a message")
    "tHKS KS C MGSSCGG"
     */
    public String encode(String message) {
        // Define the mapping for vowels
        Map<Character, Character> vowelMap = new HashMap<>();
        vowelMap.put('a', 'c');
        vowelMap.put('e', 'g');
        vowelMap.put('i', 'k');
        vowelMap.put('o', 'q');
        vowelMap.put('u', 'w');

        // StringBuilder to build the encoded message
        StringBuilder encodedMessage = new StringBuilder();

        for (char c : message.toCharArray()) {
            char processedChar = c;

            // Swap case if it is a letter
            if (Character.isLetter(c)) {
                if (Character.isLowerCase(c)) {
                    processedChar = Character.toUpperCase(c);
                } else {
                    processedChar = Character.toLowerCase(c);
                }
            }

            // Replace vowels with the corresponding mapped character
            if (vowelMap.containsKey(processedChar)) {
                processedChar = vowelMap.get(processedChar);
            }

            encodedMessage.append(processedChar);
        }

        return encodedMessage.toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.encode("test"));  // Output: "TGST"
        System.out.println(solution.encode("This is a message"));  // Output: "tHKS KS C MGSSCGG"
    }
}

