class Solution {
    /**
     * Task
     * We are given two strings s and c, you have to deleted all the characters in s that are equal to any character in c
     * then check if the result string is palindrome.
     * A string is called palindrome if it reads the same backward as forward.
     * You should return a tuple containing the result string and true/false for the check.
     * Example:
     * For s = "abcde", c = "ae", the result should be ("bcd", false)
     * For s = "abcdef", c = "b"  the result should be ("acdef", false)
     * For s = "abcdedcba", c = "ab", the result should be ("cdedc", true)
     */
    public List<Object> reverse_delete(String s, String c) {
        // Remove characters from s that are present in c
        StringBuilder result = new StringBuilder();
        for (char ch : s.toCharArray()) {
            if (!c.contains(String.valueOf(ch))) {
                result.append(ch);
            }
        }

        // Check if the resulting string is a palindrome
        boolean isPalindrome = isPalindrome(result.toString());

        // Return the result as a list containing the modified string and the boolean value
        return Arrays.asList(result.toString(), isPalindrome);
    }

    /**
     * Helper method to check if a string is a palindrome
     */
    private boolean isPalindrome(String str) {
        int left = 0;
        int right = str.length() - 1;

        while (left < right) {
            if (str.charAt(left) != str.charAt(right)) {
                return false;
            }
            left++;
            right--;
        }

        return true;
    }
}

