class Solution {
    public String exchange(List<Integer> lst1, List<Integer> lst2) {
        int oddCountLst1 = 0;
        int evenCountLst2 = 0;

        // Count odd numbers in lst1 and even numbers in lst2
        for (int num : lst1) {
            if (num % 2 != 0) {
                oddCountLst1++;
            }
        }

        for (int num : lst2) {
            if (num % 2 == 0) {
                evenCountLst2++;
            }
        }

        // Check if it's possible to make all elements of lst1 even by exchanging elements
        return oddCountLst1 <= evenCountLst2 ? "YES" : "NO";
    }
}

