class Solution {
    public String exchange(List<Integer> lst1, List<Integer> lst2) {
        // Check if there are any even numbers in lst1
        boolean hasEvenInLst1 = false;
        for (int num : lst1) {
            if (num % 2 == 0) {
                hasEvenInLst1 = true;
                break;
            }
        }

        // If lst1 already contains only even numbers, return "YES"
        if (!hasEvenInLst1) {
            return "YES";
        }

        // Count the number of odd and even numbers in both lists
        int oddCountInLst1 = 0;
        for (int num : lst1) {
            if (num % 2 != 0) {
                oddCountInLst1++;
            }
        }

        int evenCountInLst2 = 0;
        for (int num : lst2) {
            if (num % 2 == 0) {
                evenCountInLst2++;
            }
        }

        // Determine if it's possible to exchange elements
        return evenCountInLst2 >= oddCountInLst1 ? "YES" : "NO";
    }
}

