        // Helper method to check if a string is balanced
        boolean isBalanced(String s) {
            int balance = 0;
            for (char c : s.toCharArray()) {
                if (c == '(') {
                    balance++;
                } else if (c == ')') {
                    balance--;
                }
                if (balance < 0) {
                    return false;
                }
            }
            return balance == 0;
        }

        // Check both possible concatenations
        if (isBalanced(lst.get(0) + lst.get(1)) || isBalanced(lst.get(1) + lst.get(0))) {
            return "Yes";
        } else {
            return "No";
        }
    }
}

