class Solution {
    public List<Integer> sort_array(List<Integer> arr) {
        Collections.sort(arr, new Comparator<Integer>() {
            @Override
            public int compare(Integer o1, Integer o2) {
                int onesCount1 = countOnes(o1);
                int onesCount2 = countOnes(o2);

                if (onesCount1 != onesCount2) {
                    return onesCount1 - onesCount2;
                } else {
                    return o1 - o2;
                }
            }

            private int countOnes(int n) {
                int count = 0;
                while (n > 0) {
                    count += n & 1;
                    n >>= 1;
                }
                return count;
            }
        });

        return arr;
    }
}

