class Solution {
    public List<Integer> sort_array(List<Integer> arr) {
        Collections.sort(arr, new Comparator<Integer>() {
            @Override
            public int compare(Integer o1, Integer o2) {
                int onesO1 = countOnes(o1);
                int onesO2 = countOnes(o2);

                if (onesO1 != onesO2) {
                    return Integer.compare(onesO1, onesO2);
                } else {
                    return Integer.compare(o1, o2);
                }
            }

            private int countOnes(int n) {
                int count = 0;
                while (n > 0) {
                    count += n & 1;
                    n >>= 1;
                }
                return count;
            }
        });
        return arr;
    }
}

