class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int n = grid.size();
        int[][] directions = {{0, 1}, {1, 0}, {-1, 0}, {0, -1}};

        // Priority queue with (value, x, y, steps)
        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[0] - b[0]);
        pq.offer(new int[]{grid.get(0).get(0), 0, 0, 1});
        Set<String> visited = new HashSet<>();
        visited.add("0_0");

        while (!pq.isEmpty()) {
            int[] current = pq.poll();
            int val = current[0], x = current[1], y = current[2], steps = current[3];

            if (steps > k) {
                break;
            }

            for (int[] dir : directions) {
                int nx = x + dir[0], ny = y + dir[1];

                if (nx >= 0 && nx < n && ny >= 0 && ny < n && !visited.contains(nx + "_" + ny)) {
                    visited.add(nx + "_" + ny);
                    pq.offer(new int[]{grid.get(nx).get(ny), nx, ny, steps + 1});
                }
            }
        }

        // Reconstruct the path
        List<Integer> path = new ArrayList<>();
        for (int i = 0; i < k; i++) {
            path.add(grid.get(x).get(y));

            for (int[] dir : directions) {
                int nx = x + dir[0], ny = y + dir[1];

                if (!visited.contains(nx + "_" + ny) && nx >= 0 && nx < n && ny >= 0 && ny < n) {
                    visited.add(nx + "_" + ny);
                    x = nx;
                    y = ny;
                    break;
                }
            }
        }

        return path;
    }
}

