        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                int[] start = {i, j, grid.get(i).get(j)};
                queue.offer(start);
                visited.add(i + "," + j);
            }
        }

        while (!queue.isEmpty()) {
            if (k == 0) break;

            // Process all nodes at the current level
            for (int i = 0; i < queue.size(); i++) {
                int[] node = queue.poll();
                int x = node[0], y = node[1], pathValue = node[2];

                // Explore neighbors (up, down, left, right)
                for (int dx : new int[]{-1, 1, 0, 0}) {
                    for (int dy : new int[]{0, 0, -1, 1}) {
                        if (dx == 0 && dy == 0) continue;

                        int nx = x + dx, ny = y + dy;

                        if (nx >= 0 && nx < n && ny >= 0 && ny < n && !visited.contains(nx + "," + ny)) {
                            int newPathValue = pathValue * 10000 + grid.get(nx).get(ny);
                            queue.offer(new int[]{nx, ny, newPathValue});
                            visited.add(nx + "," + ny);
                        }
                    }
                }
            }

            k--;
        }

        // Extract the lexicographically smallest path
        List<Integer> result = new ArrayList<>();
        while (!queue.isEmpty()) {
            int[] node = queue.poll();
            result.add(node[2] % 10000);
        }

        Collections.sort(result);
        return result;
    }
}

