class Solution {
    private List<List<Integer>> grid;
    private int n;
    private List<Integer> result = new ArrayList<>();
    private final int[][] directions = {{0, 1}, {1, 0}, {-1, 0}, {0, -1}};

    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        this.grid = grid;
        this.n = grid.size();

        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                result.clear();
                dfs(i, j, k, new boolean[n][n], new ArrayList<>());
            }
        }

        return result;
    }

    private void dfs(int x, int y, int k, boolean[][] visited, List<Integer> path) {
        if (path.size() == k) {
            if (result.isEmpty() || comparePaths(path, result)) {
                result = new ArrayList<>(path);
            }
            return;
        }

        visited[x][y] = true;
        for (int[] dir : directions) {
            int nx = x + dir[0];
            int ny = y + dir[1];
            if (nx >= 0 && nx < n && ny >= 0 && ny < n && !visited[nx][ny]) {
                path.add(grid.get(nx).get(ny));
                dfs(nx, ny, k, visited, path);
                path.remove(path.size() - 1); // Backtrack
            }
        }

        visited[x][y] = false;
    }

    private boolean comparePaths(List<Integer> path1, List<Integer> path2) {
        if (path1.size() != path2.size()) return false;
        for (int i = 0; i < path1.size(); i++) {
            if (!path1.get(i).equals(path2.get(i))) return false;
        }
        return true;
    }
}

