            String bs = ((String) b).replace(',', '.');
            double ad = Double.parseDouble(as);
            double bd = Double.parseDouble(bs);
            return ad > bd ? Optional.of(a) : Optional.empty();
        } else if (a instanceof Integer || a instanceof Double) {
            int ai = a instanceof Integer ? (Integer) a : ((Double) a).intValue();
            double ad = a instanceof Integer ? (Integer) a : (Double) a;
            return b instanceof Integer || b instanceof Double ? 
                (ad > (b instanceof Integer ? (Integer) b : ((Double) b).intValue()) ? Optional.of(ad) : Optional.empty()) :
                (String.valueOf(ad).compareTo(String.valueOf(b)) > 0 ? Optional.of(a) : Optional.empty());
        } else if (b instanceof Integer || b instanceof Double) {
            int bi = b instanceof Integer ? (Integer) b : ((Double) b).intValue();
            double bd = b instanceof Integer ? (Integer) b : (Double) b;
