class Solution {
    public Optional<Object> compare_one(Object a, Object b) {
        if (a.equals(b)) {
            return Optional.empty();
        }

        double aConverted = convertToDouble(a);
        double bConverted = convertToDouble(b);

        if (a instanceof Integer || a instanceof Double) {
            if ((b instanceof Integer || b instanceof Double)) {
                return Optional.of(max(aConverted, bConverted));
            } else {
                throw new IllegalArgumentException("Both values must be of the same type after conversion.");
            }
        } else if (a instanceof String && b instanceof String) {
            return Optional.of(max(convertToDouble((String) a), convertToDouble((String) b)) == aConverted ? a : b);
        } else {
            throw new IllegalArgumentException("Both values must be of the same type after conversion.");
        }
    }

    private double convertToDouble(Object value) {
        if (value instanceof Integer) {
            return ((Integer) value).doubleValue();
        } else if (value instanceof Double) {
            return (Double) value;
        } else if (value instanceof String) {
            try {
                return Double.parseDouble(((String) value).replace(',', '.'));
            } catch (NumberFormatException e) {
                throw new IllegalArgumentException("Invalid number format: " + value);
            }
        } else {
            throw new IllegalArgumentException("Unsupported type: " + value.getClass().getName());
        }
    }

    private double max(double a, double b) {
        return Math.max(a, b);
    }
}

