class Solution {
    public String file_name_check(String file_name) {
        // Check for more than three digits
        if (file_name.matches(".*\\d.*\\d.*\\d.*\\d")) {
            return "No";
        }

        // Check for exactly one dot
        int dotCount = 0;
        for (char c : file_name.toCharArray()) {
            if (c == '.') {
                dotCount++;
            }
        }
        if (dotCount != 1) {
            return "No";
        }

        // Split the filename into name and extension
        String[] parts = file_name.split("\\.");
        if (parts.length != 2 || parts[0].isEmpty()) {
            return "No";
        }

        // Check if the name starts with a letter
        char firstChar = parts[0].charAt(0);
        if (!Character.isLetter(firstChar)) {
            return "No";
        }

        // Check if the extension is one of the allowed ones
        String ext = parts[1];
        if (!ext.equalsIgnoreCase("txt") && !ext.equalsIgnoreCase("exe") && !ext.equalsIgnoreCase("dll")) {
            return "No";
        }

        return "Yes";
    }
}

