            }
        }

        // Handle trailing spaces
        if (spaceCount > 2) {
            result.append('-');
        } else if (spaceCount >= 1) {
            for (int i = 0; i < spaceCount; i++) {
                result.append('_');
            }
        }

        return result.toString();
    }
}

