class Solution {
    /**
    Given a string text, replace all spaces in it with underscores,
    and if a string has more than 2 consecutive spaces,
    then replace all consecutive spaces with -

    fix_spaces("Example") == "Example"
    fix_spaces("Example 1") == "Example_1"
    fix_spaces(" Example 2") == "_Example_2"
    fix_spaces(" Example   3") == "_Example-3"
     */
    public String fix_spaces(String text) {
        StringBuilder result = new StringBuilder();
        int consecutiveSpacesCount = 0;

        for (int i = 0; i < text.length(); i++) {
            char currentChar = text.charAt(i);

            if (currentChar == ' ') {
                consecutiveSpacesCount++;
            } else {
                if (consecutiveSpacesCount > 2) {
                    result.append('-');
                } else if (consecutiveSpacesCount >= 1) {
                    for (int j = 0; j < consecutiveSpacesCount; j++) {
                        result.append('_');
                    }
                }

                consecutiveSpacesCount = 0;
                result.append(currentChar);
            }
        }

        // Handle trailing spaces
        if (consecutiveSpacesCount > 2) {
            result.append('-');
        } else if (consecutiveSpacesCount >= 1) {
            for (int j = 0; j < consecutiveSpacesCount; j++) {
                result.append('_');
            }
        }

        return result.toString();
    }
}

