        Collections.sort(nums, new Comparator<Integer>() {
            @Override
            public int compare(Integer o1, Integer o2) {
                int sum1 = digitSum(o1);
                int sum2 = digitSum(o2);

                if (sum1 == sum2) {
                    return nums.indexOf(o1) - nums.indexOf(o2);
                }
                return sum1 - sum2;
            }
        });
        return nums;
    }

