        boolean isNegative = n < 0;
        String absStr = Integer.toString(Math.abs(n));
        int sum = 0;
        for (char c : absStr.toCharArray()) {
            sum += Character.getNumericValue(c);
        }
        return isNegative ? sum + 1 : sum;
    }
}

