class Solution {
    /**
     * Write a function which sorts the given list of integers in ascending order according to the sum of their digits.
     * Note: if there are several items with similar sum of their digits, order them based on their index in the original list.
     * If an integer is negative, then its first digit will be negative:
     * e.g. -123 has digits -1, 2, and 3.
     *
     * For example:
     * >>> order_by_points(Arrays.asList(1, 11, -1, -11, -12)) == [-1, -11, 1, -12, 11]
     * >>> order_by_points(Arrays.asList()) == []
     */
    public List<Integer> order_by_points(List<Integer> nums) {
        // Custom comparator to sort based on digit sum and original index
        Comparator<Integer> comparator = (a, b) -> {
            int digitSumA = digitSum(a);
            int digitSumB = digitSum(b);

            if (digitSumA != digitSumB) {
                return Integer.compare(digitSumA, digitSumB);
            } else {
                return nums.indexOf(a) - nums.indexOf(b);
            }
        };

        // Sort the list using the custom comparator
        Collections.sort(nums, comparator);

        return nums;
    }

    // Helper function to calculate the sum of digits of an integer
    private int digitSum(int num) {
        if (num == 0) return 0;
        boolean isNegative = num < 0;
        int absNum = Math.abs(num);
        int sum = 0;

        while (absNum > 0) {
            int digit = absNum % 10;
            sum += digit;
            absNum /= 10;
        }

        if (isNegative) {
            return -sum;
        } else {
            return sum;
        }
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.order_by_points(Arrays.asList(1, 11, -1, -11, -12))); // Output: [-1, -11, 1, -12, 11]
        System.out.println(solution.order_by_points(Arrays.asList()));                   // Output: []
    }
}

