class Solution {
    public List<String> bf(String planet1, String planet2) {
        List<String> planets = Arrays.asList("Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune");

        if (!planets.contains(planet1) || !planets.contains(planet2)) {
            return new ArrayList<>();
        }

        int start = planets.indexOf(planet1);
        int end = planets.indexOf(planet2);

        if (start > end) {
            Collections.swap(planets, start, end);
            start = planets.indexOf(planet1);
            end = planets.indexOf(planet2);
        }

        return new ArrayList<>(planets.subList(start + 1, end));
    }
}

