class Solution {
    public List<Integer> even_odd_count(int num) {
        int evenCount = 0;
        int oddCount = 0;

        // Make sure num is positive for simplicity
        num = Math.abs(num);

        while (num > 0) {
            int digit = num % 10;
            if (digit % 2 == 0) {
                evenCount++;
            } else {
                oddCount++;
            }
            num /= 10; // Use integer division to remove the last digit
        }

        List<Integer> result = new ArrayList<>();
        result.add(evenCount);
        result.add(oddCount);

        return result;
    }
}

