     * sides form a right-angled triangle, false otherwise.
     * A right-angled triangle is a triangle in which one angle is 90 degrees.
     *
     * Example:
     * right_angle_triangle(3, 4, 5) == true
     * right_angle_triangle(1, 2, 3) == false
     */
    public boolean right_angle_triangle(int a, int b, int c) {
        // Sort the sides to ensure that c is the longest side
        if (a > c) {
            int temp = a;
            a = c;
            c = temp;
        }
        if (b > c) {
            int temp = b;
            b = c;
            c = temp;
        }

        // Check if the square of the longest side equals the sum of squares of other two sides
        return Math.pow(c, 2) == (Math.pow(a, 2) + Math.pow(b, 2));
    }
}

