import java.util.*;
import java.lang.*;

class Solution {
    /**
     * Evaluates polynomial with coefficients xs at point x.
     * return xs[0] + xs[1] * x + xs[1] * x^2 + .... xs[n] * x^n
     */
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    /**
     * xs are coefficients of a polynomial.
     * find_zero finds x such that poly(x) = 0.
     * find_zero returns only one zero point, even if there are many.
     * Moreover, find_zero only takes list xs having an even number of coefficients
     * and the largest non-zero coefficient as it guarantees a solution.
     */
    public double find_zero(List<Double> xs) {
        if (xs.size() % 2 != 0) {
            throw new IllegalArgumentException("The list of coefficients must have an even number of elements.");
        }

        // Ensure the largest non-zero coefficient is at the end
        int maxCoeffIndex = -1;
        double maxCoeffValue = Double.MIN_VALUE;
        for (int i = 0; i < xs.size(); i++) {
            if (xs.get(i) != 0 && Math.abs(xs.get(i)) > maxCoeffValue) {
                maxCoeffValue = Math.abs(xs.get(i));
                maxCoeffIndex = i;
            }
        }

        // Move the largest non-zero coefficient to the end
        Collections.rotate(xs, xs.size() - 1 - maxCoeffIndex);

        double x = 0.0;

        // Use Newton's method to find the root
        while (Math.abs(poly(xs, x)) > 1e-6) {
            double derivativeSum = 0;
            for (int i = 1; i < xs.size(); i++) {
                derivativeSum += xs.get(i) * Math.pow(x, i - 1);
            }
            x -= poly(xs, x) / derivativeSum;
        }

        return x;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        Random rand = new Random(42);
        for (int i = 0; i < 100; i++) {
            int ncoeff = 2 * (rand.nextInt(3) + 1);
            List<Double> coeffs = new ArrayList<>();
            for (int j = 0; j < ncoeff; j++) {
                int coeff = rand.nextInt(20) - 10;
                if (coeff == 0) {
                    coeff = 1;
                }
                coeffs.add((double) coeff);
            }
            double solution = s.find_zero(coeffs);
            if (Math.abs(s.poly(coeffs, solution)) > 1e-4) {
                throw new AssertionError();
            }
        }
    }
}

