class Solution {
    /**
     Evaluates polynomial with coefficients xs at point x.
     return xs[0] + xs[1] * x + xs[1] * x^2 + .... xs[n] * x^n
      */
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    /**
     xs are coefficients of a polynomial.
     find_zero find x such that poly(x) = 0.
     find_zero returns only one zero point, even if there are many.
     Moreover, find_zero only takes list xs having even number of coefficients
     and largest non zero coefficient as it guarantees
     a solution.
      */
    public double find_zero(List<Double> xs) {
        if (xs.size() % 2 != 0) {
            throw new IllegalArgumentException("The list of coefficients must have an even number of elements.");
        }

        // Ensure the largest non-zero coefficient is at the end
        List<Double> nonZeroCoefficients = new ArrayList<>();
        for (double c : xs) {
            if (c != 0) {
                nonZeroCoefficients.add(c);
            }
        }
        if (nonZeroCoefficients.isEmpty() || Math.abs(nonZeroCoefficients.get(nonZeroCoefficients.size() - 1)) == 0) {
            throw new IllegalArgumentException("There should be a non-zero coefficient to guarantee a solution.");
        }

        // Initial interval based on the sign change of the polynomial at endpoints
        if (xs.get(0) * xs.get(xs.size() - 1) > 0) {
            throw new IllegalArgumentException("No root in the given range.");
        }

        for (int i = 0; i < xs.size(); i++) {
            if (poly(xs, i) == 0) {
                return i;
            }
        }

        // Use bisection method to find a zero point
        double a = -10.0;
        double b = 10.0;
        while (Math.abs(b - a) > 1e-6) { // Tolerance for the root
            double mid = (a + b) / 2.0;
            if (poly(xs, mid) == 0) {
                return mid;
            } else if (poly(xs, mid) * poly(xs, a) < 0) {
                b = mid;
            } else {
                a = mid;
            }
        }

        return (a + b) / 2.0;
    }
}

