class Solution {
    public List<Integer> strange_sort_list(List<Integer> lst) {
        Collections.sort(lst); // Sort the list in ascending order
        List<Integer> result = new ArrayList<>();
        int left = 0; // Start index
        int right = lst.size() - 1; // End index

        while (left <= right) {
            if (left == right) {
                result.add(lst.get(left)); // If only one element is left, add it to the result
            } else {
                result.add(lst.get(left++)); // Add the minimum value from the sorted list
                result.add(lst.get(right--)); // Add the maximum value from the remaining part of the sorted list
            }
        }

        return result;
    }
}

